import React from "react";
import styled from "styled-components";

const LogoHome = () => {
  return (
    <div className="logo">
      <img src={logo2} alt="logo" />
    </div>
  );
};

export default LogoHome;

const LogoHeader = styled.div`
  .logo {
    margin: 0 auto;
    width: 18rem;
    img {
      height: 20rem;
      width: 18rem;
      margin-bottom: 8rem;
    }
  }
`;
